import React from 'react';
import ReactDOM from 'react-dom';
import {createGlobalStyle} from 'styled-components'

const GlobalStyles = createGlobalStyle`
  html,
  body {
    margin: 0;
    padding: 0;
  }

  body {
    font-family: Roboto, sans-serif;
  }
`;

ReactDOM.render(
    <h1>Hello, World!</h1>,
    document.getElementById('root')
);
